import React from 'react';
import './Header.css'; // Import the CSS file for header styles
import Hamburger from './Hamburger'; // Import the Hamburger component
import logoImage from '../assets/jayce1.png'; 

function Header() {
  return (
    <header>
      <div className="container">
      <img src={logoImage} alt="mylogo" width="150"/>
        <div className="title">Jayce Turambe</div>
        <nav>
          <ul>
            <li><a href="#profile">Profile</a></li>
            <li><a href="#projects">Projects</a></li>
            <li><a href="#about">About</a></li>
            <li><a href="#contact">Contact</a></li>
          </ul>
        </nav>
        <Hamburger /> {/* Render the Hamburger component */}
      </div>
    </header>
  );
}

export default Header;
